ve the interest of the Company at heart, and will do whatever is necessary to improve the situation on ground.<br />\r\n<br />\r\nFor everyone that choose to work during this time, please be aware that there is no surety we will be able to afford paying you anytime in the future.<br />\r\n<br />\r\nHowever, if things do well than the doom we forsee and we are able to establish profitability even in the month, everyone who actively work will be fully compensated in full base salary.<br />\r\n<br />\r\nThank you for your continued contributions to the company. If you have any further questions, please get in contact with the necessary quarters.<br />\r\n<br />\r\nYou can also drop your observations, questions, and comment and your availability status during the month.<br />\r\n<br />\r\nIt is a tough time, but I believe we are tough people. And as it is often echoed, tough times don\'t last only tough people do.<br />\r\n<br />\r\nTimmy Brian,<br />\r\nLead Director, *FUTUREX DIGITAL*.',NULL,NULL,NULL,'submitted','10.15.154.196','Mozilla/5.0 (Linux; U; Android 9; Redmi Note 8 Pro Build/PPR1.180610.011; wv) AppleWebKit/537.36 (KHTML, like Gecko) Version/4.0 Chrome/80.0.3987.162 Mobile Safari/537.36 OPR/47.0.2254.146760','2020-04-02 16:36:47','2020-04-02 16:36:47',NULL,NULL,'text',0),(2421,NULL,401,'She\'s kinda proud sha',NULL,NULL,NULL,'submitted','10.12.135.75','Mozilla/5.0 (Linux; U; Android 9; en-gb; Redmi Note 8 Pro Build/PPR1.180610.011) AppleWebKit/537.36 (KHTML, like Gecko) Version/4.0 Chrome/71.0.3578.141 Mobile Safari/537.36 XiaoMi/MiuiBrowser/11.4.3-g','2020-04-02 16:57:59','2020-04-02 16:57:59',NULL,NULL,'text',0),(2441,NULL,381,'How far now, ebi n pa mi ooo',NULL,NULL,NULL,'submitted','10.9.82.109','Mozilla/5.0 (Linux; Android 9; Infinix X626B) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/80.0.3987.149 Mobile Safari/537.36','2020-04-02 18:49:46','2020-04-02 18:49:46',NULL,NULL,'text',0),(2451,NULL,231,'Gentle ugly guy',NULL,NULL,NULL,'submitted','10.11.72